import React from 'react';
import style from './style.js'

const cookieButton = (onClick) => (
    <div style={style.img}>
        <button img="https://cdn.discordapp.com/attachments/729502632963473499/1199467432843149322/chocolate-chip-cookie-butter-cookie-cookie-png-5869876d39c1c6e51df3cbfc44b0ac91.png?ex=65c2a619&is=65b03119&hm=e7dedd32561cea991da74b791e94bd835f49def734c0bda47059521c9db55e4a&" width="350" height="250"/>
    </div>     
);

export default cookieButton;
